import {React, Component} from 'react';
import InformationSelector from './index.js';

class FetchCity extends React.Component{

    state = {
        loading: true,
        city: "",
        url: ""
    };

    render(){
        return <div>
            {this.state.loading ? <div>{InformationSelector.state.city}</div> : <div>cityName</div>}
        </div>;
    }
}

export default FetchCity;
